import React from 'react';
import './home.css';
import Navbar from '../../components/common/navbar';

function home() {
    return (
        <div class="home">
            <Navbar />
            <div class="BGimg"/>
            <div class="SearchSectionContainer"/>
        </div>
    );
}

export default home;
